import * as React from "react";
import { Button, StatusBar, Text, View, Image } from "react-native";
import styled from "styled-components";
import { FontAwesome5, MaterialIcons, AntDesign } from "@expo/vector-icons";

const MainpageToolbar = () => {
  return (
    <Container>
      <Header>
        <ProfilePhoto source={require("./profilePicture.png")} />
        <Welcome>
          <Text style={{ color: "#dcdcdc" }}>Welcome,</Text>

          <Text style={{ color: "#808080" }}>Blockchain Hero</Text>
        </Welcome>
        <FontAwesome5 name="cog" size={24} color="#565656" />
      </Header>
      <Text
        style={{
          color: "#808080",
          alignSelf: "center",
          justifyContent: "center",
          fontSize: 20.0,
        }}
      >
        {" "}
        Your last login was 23/02/2021
      </Text>

      <Purchases
        ListHeaderComponent={
          <TransactionsHeader>
            <Text>Last purchases</Text>
            <MaterialIcons name="sort" size={24} color="#5196f4" />
            <SearchContainer>
              <AntDesign name="search1" size={18} color="#5196f4"></AntDesign>
              <Search placeholder="Search Transactions"></Search>
            </SearchContainer>
          </TransactionsHeader>
        }
      ></Purchases>

      <StatusBar barStyle="light-content" />
    </Container>
  );
};
export default MainpageToolbar;
// const StatusBar = styled.StatusBar``;

const ProfilePhoto = styled.Image`
  width: 40;
  height: 40;
  border-radius: 20px;
`;

const Container = styled.View`
  flex: 1;
  background-color: #1e1e1e;
`;

const Header = styled.View`
  flex-direction: row;
  align-items: center;
  margin: 16px 16px 32px 16px;
`;

const Purchases = styled.FlatList`
  background-color: #2c2c2c;
  padding: 16px;
`;
const TransactionsHeader = styled.View`
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
`;

const SearchContainer = styled.View`
  background-color: #3d3d3d;
  flex-direction:row;
  align-items:center;
  padding 0 8px
  border-radius:6px;
`;

const Search = styled.TextInput``;

const Welcome = styled.View`
  flex: 1;
  padding: 16px;
`;
